let env = {
    isinwap:false,
    isinapp:false
}

if(window.navigator.userAgent.match(/gome\/|gomeplus\//)){
   env.isinwap = false
   env.isinapp = true
}else{
   env.isinwap = true
   env.isinapp = false
}

export default env

